import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter as Router,Route,Routes} from 'react-router-dom';
import Registeration from './Registeration';
import Login from './Login'
import Home from './Home'
import Rooms from './Rooms'
import Logout from './Logout'
import Account from './Account'
var token=JSON.parse(localStorage.getItem('token'));
ReactDOM.render(
  <Router>
  <Routes>
  <Route path="/Login" element={token===""?<Login/>:<Home/>}></Route>
      <Route path="/Login/Registeration" element={token===""?<Registeration/>:<Home/>}></Route>
      <Route exact path="/" element={<Home/>}></Route>
      <Route path="/Rooms" element={token!==""?<Rooms/>:<Home/>}></Route>
      <Route path="/Logout" element={<Logout/>}></Route>
      <Route path="/Account" element={token!==""?<Account/>:<Home/>}></Route>
  </Routes>
  </Router>,
  document.getElementById('root')
);
